import React from 'react'
import styled from 'styled-components'


const HomePageRouter: React.FC = () => {


    return (
        <StyledSectionsHolder>
        <StyledSections className="firstSection" ><a >More About Me</a></StyledSections>
        <StyledSections className="secondSection" ><a href="#">Past Projects</a></StyledSections>
        <StyledSections className="thirdSection" ><a href="#">Tools, Libraries and Languages</a></StyledSections>
        <StyledSections className="fourthSection" ><a href="#" title="Why I'm rubbish at writing link text: An explanation and an apology.">Past Dapp Information</a></StyledSections>
        </StyledSectionsHolder>
    )
}

const StyledSections = styled.a`
    height: 10%;
    width: 100%;
    padding:2%;
    box-shadow: 2px 3px #0F0F0F;
    display: flex;
    justify-content: center;
    align-items: center;
`
const StyledSectionsHolder = styled.div`
    height: 100%;
    width: 96%;
    display: flex;
    flex-direction: column;
`

export default HomePageRouter
